const KarlaRegular = `@font-face { font-family: 'Karla'; font-style: normal; font-weight: 400; src: local('Karla'), local('Karla-Regular'), url('data:font/woff2;base64,') format('woff2'); }`;
const KarlaItalic = `@font-face { font-family: 'Karla'; font-style: italic; font-weight: 400; src: local('Karla Italic'), local('Karla-Italic'), url('data:font/woff2;base64,') format('woff2'); }`;
const Karla700 = `@font-face { font-family: 'Karla'; font-style: normal; font-weight: 700; src: local('Karla Bold'), local('Karla-Bold'), url('data:font/woff2;base64,') format('woff2'); }`;
const Karla700italic = `@font-face { font-family: 'Karla'; font-style: italic; font-weight: 700; src: local('Karla Bold Italic'), local('Karla-BoldItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
